import React from "react";

function PollQuestion() {
  return (
    <div style={{ height: "22vh", width: "100%", marginTop: "2vh" }}>
      <p style={{ fontWeight: "600", fontSize: "1.3em", letterSpacing: "1px" }}>
        Q.1 Question place holder for analysis ?{" "}
      </p>

      <div
        style={{
          display: "flex",
          gap: "4vw",
          marginLeft: "2vw",
          marginTop: "4vh",
        }}
      >
        <div
          style={{
            color: "#474444",
            fontWeight: "600",  
            backgroundColor: "white",
            borderRadius: "5px",
            paddingTop: "3vh",
            paddingBottom:"2vh",
            paddingLeft:"3vw",
            width:"15vw"
          }}
        >
          <p style={{ fontSize: "1.8em" }}>60
          <span style={{fontSize:"0.6em",marginLeft:"1.5vw",}}>Option 1</span>
          </p>
        </div>

        <div
          style={{
            color: "#474444",
            fontWeight: "600",
            height: "10vh",
            width: "20vw",
            backgroundColor: "white",
            borderRadius: "5px",
            textAlign: "center",
            paddingTop: "1.3vh",
          }}
        >
          <p style={{ fontSize: "1.8em", marginBottom: "0.3vh" }}>38</p>
          <p>People Answered Correctly</p>
        </div>

        <div
          style={{
            color: "#474444",
            fontWeight: "600",
            height: "10vh",
            width: "20vw",
            backgroundColor: "white",
            borderRadius: "5px",
            textAlign: "center",
            paddingTop: "1.3vh",
          }}
        >
          <p style={{ fontSize: "1.8em", marginBottom: "0.3vh" }}>22</p>
          <p>People Answered Incorrectly</p>
        </div>
      </div>
    </div>
  );
}

export default PollQuestion;
